import { config } from "./config"
import { defaultScene } from "./defaulfScene"
import { assets } from "./engineAssets"

export const files = {
  type: `folder`,
  scenes: {
    type: `folder`,
    defaultScene
  },
  assets,
  folder1: {
    type: `folder`,
    object2: {
      type: `text`,
      value: `str 2`
    },
    obj3: {
      type: `folder`,
      obj4: {
        type: `text`,
        value: `str 3`
      },
      obj5: {
        type: `text`,
        value: `str 4`
      }
    }
  },
  folder2: {
    type: `folder`,
    object2: {
      type: `text`,
      value: `str 5`
    },
    obj2: {
      type: `folder`,
      obj4: {
        type: `text`,
        value: `str 5`
      },
      obj5: {
        type: `text`,
        value: `str 8`
      }
    }
  },
  config
}
